import{_ as e,c as o,o as n,a as d}from"./app.d95e124d.js";const v='{"title":"\u524D\u60C5\u63D0\u8981","description":"","frontmatter":{},"headers":[{"level":2,"title":"\u524D\u60C5\u63D0\u8981","slug":"\u524D\u60C5\u63D0\u8981"},{"level":2,"title":"\u5199\u4E00\u4E2A\u4E0D\u8003\u8651\u865A\u62DFdom\u7684render","slug":"\u5199\u4E00\u4E2A\u4E0D\u8003\u8651\u865A\u62DFdom\u7684render"},{"level":2,"title":"render\u53C2\u6570\u5BF9\u8C61","slug":"render\u53C2\u6570\u5BF9\u8C61"},{"level":2,"title":"\u5199render\u548Ctemplate\u7684\u533A\u522B","slug":"\u5199render\u548Ctemplate\u7684\u533A\u522B"},{"level":2,"title":"JSX","slug":"jsx"},{"level":3,"title":"\u8F6C\u8BD1","slug":"\u8F6C\u8BD1"},{"level":2,"title":"\u51FD\u6570\u5F0F\u7EC4\u4EF6","slug":"\u51FD\u6570\u5F0F\u7EC4\u4EF6"}],"relativePath":"vue/\u91CD\u5B66vue-03render\u51FD\u6570.md","lastUpdated":1664437294106}',c={},a=d(`<h2 id="\u524D\u60C5\u63D0\u8981" tabindex="-1">\u524D\u60C5\u63D0\u8981 <a class="header-anchor" href="#\u524D\u60C5\u63D0\u8981" aria-hidden="true">#</a></h2><p>\u6309\u7167vue\u7684\u5B98\u65B9\u6587\u6863\uFF0C\u672C\u5E94\u5148\u770Bvue\u7684\u6307\u4EE4(<code>v-model\u3001v-show\u3001v-for</code>...) \u8FD9\u91CC\u5728\u8BB2\u6307\u4EE4\u4E4B\u524D\uFF0C\u6211\u4EEC\u5148\u8BB2vue\u7684<code>render\u51FD\u6570</code>\uFF0C\u56E0\u4E3Avue\u7684\u6307\u4EE4\u89E3\u6790\u4E4B\u540E\u5C31\u662F\u4F5C\u7528\u4E8E<code>render\u51FD\u6570</code></p><blockquote><p><a href="https://cn.vuejs.org/v2/guide/render-function.html" target="_blank" rel="noopener noreferrer">Vue \u63A8\u8350\u5728\u7EDD\u5927\u591A\u6570\u60C5\u51B5\u4E0B\u4F7F\u7528\u6A21\u677F\u6765\u521B\u5EFA\u4F60\u7684 HTML\u3002\u7136\u800C\u5728\u4E00\u4E9B\u573A\u666F\u4E2D\uFF0C\u4F60\u771F\u7684\u9700\u8981 JavaScript \u7684\u5B8C\u5168\u7F16\u7A0B\u7684\u80FD\u529B\u3002\u8FD9\u65F6\u4F60\u53EF\u4EE5\u7528\u6E32\u67D3\u51FD\u6570\uFF0C\u5B83\u6BD4\u6A21\u677F\u66F4\u63A5\u8FD1\u7F16\u8BD1\u5668\u3002</a></p></blockquote><p>\u8981\u7406\u89E3render\u5C31\u8981\u77E5\u9053Vue\u7684DOM\u6E32\u67D3\u8FC7\u7A0B</p><p><img src="https://kingan-md-img.oss-cn-guangzhou.aliyuncs.com/blog/20220316194111.png" alt=""></p><p>\u{1F446}\u6211\u4EEC\u77E5\u9053Vue\u7528\u7684\u662F<code>\u865A\u62DFDOM</code>\u6E32\u67D3\u6210<code>\u771F\u5B9EDOM</code>(\u5173\u4E8E<code>\u865A\u62DFDOM</code>\u7684\u610F\u4E49\u3001\u6027\u80FD\`\uFF0C\u6211\u4EEC\u4F1A\u53E6\u5916\u5206\u6790)</p><blockquote><p>\u6211\u4EEC\u628A\u8FD9\u6837\u7684\u8282\u70B9\u63CF\u8FF0\u4E3A<code>\u201C\u865A\u62DF\u8282\u70B9 (virtual node)\u201D</code>\uFF0C\u4E5F\u5E38\u7B80\u5199\u5B83\u4E3A<code>\u201CVNode\u201D</code></p><p><code>\u201C\u865A\u62DF DOM\u201D</code>\u662F\u6211\u4EEC\u5BF9\u7531 <code>Vue</code> \u7EC4\u4EF6\u6811\u5EFA\u7ACB\u8D77\u6765\u7684\u6574\u4E2A <code>VNode \u6811</code>\u7684\u79F0\u547C</p></blockquote><ul><li><code>VNode</code>: \u865A\u62DF\u8282\u70B9</li><li><code>\u865A\u62DFDOM</code>: <code>\u865A\u62DFDOM</code>\u6811(\u7531\u5404\u79CD\u865A\u62DF\u8282\u70B9\u7EC4\u6210)</li></ul><p>\u{1F446} \u5B98\u65B9\u6587\u6863\u5BF9<code>\u865A\u62DFDOM</code>\u7684\u89E3\u91CA\uFF0C\u6211\u4EEC\u9700\u8981\u77E5\u9053<code>\u865A\u62DFDOM</code>\u5E76\u4E0D\u662FVue\u72EC\u6709\u7684\u4E1C\u897F \u4EC5\u4EC5\u662F\u6982\u5FF5\uFF0C\u4E0D\u5F71\u54CD\u6211\u4EEC\u5BF9\u6574\u4F53\u7684\u5B66\u4E60\uFF0C\u4F46\u662F\u6211\u4EEC\u8FD8\u662F\u533A\u5206\u597D\u4EE5\u514D\u9020\u6210\u6982\u5FF5\u6DF7\u6DC6</p><hr><p><strong>\u601D\u8003\u{1F914}</strong></p><ul><li>\u90A3\u6211\u4EEC\u5E73\u65F6\u5199\u7684\u4EE3\u7801\u5C31\u662F<code>\u865A\u62DFDOM</code>\u4E86\u5417\uFF1F</li><li><code>\u865A\u62DFDOM</code>\u6E32\u67D3\u771F\u5B9EDOM\u7684\u6B65\u9AA4\u53D1\u751F\u5728\u54EA\u91CC\u5462\uFF1F</li></ul><p>\u6211\u4EEC\u5E73\u65F6\u5199\u7684\u4EE3\u7801\u662F<code>.vue</code>\u6587\u4EF6\u7684<code>&lt;template&gt;</code>\u6A21\u7248 \u6216\u8005\u50CF\u524D\u9762\u8BB2\u89E3Vue\u7684\u6A21\u677F\u8BED\u6CD5\u529F\u80FD\u7684\u793A\u4F8B\u4EE3\u7801\uFF0C\u5199<code>new Vue</code>\u7684\u914D\u7F6E\u9879<code>template:&#39;&lt;p&gt;123&lt;/p&gt;&#39;</code> \u5F88\u660E\u663E\uFF0C\u8FD9\u4E9B\u90FD\u4E0D\u662FVNode\uFF0C\u4E5F\u4E0D\u662F\u771F\u5B9EDOM</p><p>\u6211\u4EEC\u5199\u51FA\u6765\u7684<code>.vue</code>\u6587\u4EF6\u4F1A\u7ECF\u8FC7\u6253\u5305\u5DE5\u5177\u5982<code>webpack</code>\u7684\u89E3\u6790(\u501F\u52A9<code>vue-loader</code>)\uFF0C\u6253\u5305\u6210<code>render\u51FD\u6570</code>\u7684js</p><p>\u6253\u5305\u4E0A\u7EBF\u540E\uFF0C\u6D4F\u89C8\u5668\u6267\u884C\u8FD9\u6BB5<code>render\u51FD\u6570</code>\u751F\u6210VNode\uFF0C\u518D\u7531vue\u5185\u90E8\u51B3\u5B9A\u5728\u4EC0\u4E48\u65F6\u673A\u6E32\u67D3\u6210\u771F\u5B9EDOM</p><p>\u6CE8\u610F: \u5BB9\u6613\u6709\u7684\u8BEF\u533A\uFF0C\u6211\u4EEC\u5E38\u7528\u7684vue\u5E93\u7248\u672C\u662Fruntime\u7248\uFF0C\u8FD9\u4E2A\u7248\u672C\u4E0D\u652F\u6301\u76F4\u63A5\u5199template\u7684\u4EE3\u7801\u6E32\u67D3\u6210\u771F\u5B9EDOM\uFF0C<a href="./\u91CD\u5B66vue-01\u6A21\u677F\u8BED\u6CD5.html#\`\u3001\u8FD0\u884C\u65F6\u7248-runtime">vue\u5BF9\u5916\u7684\u8D44\u6E90js\u4E3A\u4EC0\u4E48\u8FD9\u4E48\u591A\u7248\u672C</a>\u4E2D\u6211\u4EEC\u5C1D\u8BD5\u7528runtime\u7248\u8FD0\u884C\u6A21\u7248\u8BED\u6CD5\u4F1A\u62A5\u9519\uFF0Cruntime\u7248\u53EA\u80FD\u901A\u8FC7<code>render\u51FD\u6570</code>\u6E32\u67D3\u51FA\u771F\u5B9EDOM</p><hr><h2 id="\u5199\u4E00\u4E2A\u4E0D\u8003\u8651\u865A\u62DFdom\u7684render" tabindex="-1">\u5199\u4E00\u4E2A\u4E0D\u8003\u8651\u865A\u62DFdom\u7684render <a class="header-anchor" href="#\u5199\u4E00\u4E2A\u4E0D\u8003\u8651\u865A\u62DFdom\u7684render" aria-hidden="true">#</a></h2><div class="language-js"><pre><code>

</code></pre></div><blockquote><p>\u6211\u4EEC\u73B0\u5728\u5148\u628A\u6CE8\u610F\u529B\u653E\u5728\u5355\u4E2A\u7684<code>\u865A\u62DF\u8282\u70B9</code>\u4E0A\uFF0C\u4E0D\u8003\u8651\u6811\u72B6<code>\u865A\u62DFDOM</code>\u7684\u6570\u636E\u534F\u4F5C(\u540E\u9762\u518D\u8865)</p></blockquote><p>\u4E0B\u9762\u7528<code>VNode</code>\u6307\u4EE3<code>\u865A\u62DF\u8282\u70B9</code></p><h2 id="render\u53C2\u6570\u5BF9\u8C61" tabindex="-1">render\u53C2\u6570\u5BF9\u8C61 <a class="header-anchor" href="#render\u53C2\u6570\u5BF9\u8C61" aria-hidden="true">#</a></h2><p><a href="https://cn.vuejs.org/v2/guide/render-function.html#%E6%B7%B1%E5%85%A5%E6%95%B0%E6%8D%AE%E5%AF%B9%E8%B1%A1" target="_blank" rel="noopener noreferrer">\u6E32\u67D3\u51FD\u6570&amp;JSX - \u5B98\u65B9\u6587\u6863</a></p><p>\u6CE8\u610F\u7684\u5199\u6E32\u67D3\u51FD\u6570\u4E0D\u652F\u6301vue\u7684\u8BED\u6CD5\u7CD6\u6307\u4EE4</p><p>\u53E6\u5916\uFF0C\u6E32\u67D3\u51FD\u6570\u6267\u884C\u540E\u8FD4\u56DE\u7684\u662F\u4E00\u4E2A<code>VNode</code>\u5BF9\u8C61</p><p>\u6211\u4EEC\u53EF\u4EE5\u6253\u5370\u4E00\u4E0B <code>VNode</code></p><div class="language-js"><pre><code><span class="token keyword">const</span> config <span class="token operator">=</span> <span class="token punctuation">{</span>
  <span class="token literal-property property">el</span><span class="token operator">:</span> <span class="token string">&#39;#app&#39;</span><span class="token punctuation">,</span>
  <span class="token function-variable function">render</span><span class="token operator">:</span><span class="token punctuation">(</span><span class="token parameter">h</span><span class="token punctuation">)</span><span class="token operator">=&gt;</span><span class="token punctuation">{</span>
    <span class="token keyword">const</span> VNode <span class="token operator">=</span> <span class="token function">h</span><span class="token punctuation">(</span><span class="token string">&#39;h1&#39;</span><span class="token punctuation">,</span><span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span><span class="token string">&#39;\u6D4B\u8BD5render&#39;</span><span class="token punctuation">)</span>
    console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>Vnode<span class="token punctuation">)</span>
    <span class="token keyword">return</span> VNode <span class="token comment">// \u6CE8\u610Frender\u914D\u7F6E\u9879 \u51FD\u6570\u8981\u8FD4\u56DEVNode</span>
  <span class="token punctuation">}</span>
<span class="token punctuation">}</span><span class="token punctuation">;</span>
<span class="token keyword">const</span> app <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">Vue</span><span class="token punctuation">(</span>config<span class="token punctuation">)</span>
</code></pre></div><p>\u{1F446} \u53EF\u4EE5\u770B\u5230\u4E00\u4E2A<code>VNode</code>\u91CC\u9762\u662F\u5E26\u7740\u771F\u5B9EDOM\u7684\uFF0C\u6240\u4EE5\u865A\u62DFDOM\u5E76\u6CA1\u6709\u529E\u6CD5\u8131\u79BB\u771F\u5B9EDOM\u7684\u8303\u7574\uFF0C\u5E76\u4E14\u5728\u6D4F\u89C8\u5668\u5185\u5B58\u4E2D\u5B58\u7740\u4E00\u4EFD\u771F\u5B9EDOM \u751A\u81F3\u7ED5\u8FC7\u865A\u62DFDOM,\u76F4\u63A5\u64CD\u4F5CDOM\u6027\u80FD\u4F1A\u66F4\u597D</p><p>\u601D\u8003\u{1F914}: \u865A\u62DFDOM\u5230\u5E95\u6709\u4EC0\u4E48\u597D\u5904</p><h2 id="\u5199render\u548Ctemplate\u7684\u533A\u522B" tabindex="-1">\u5199render\u548Ctemplate\u7684\u533A\u522B <a class="header-anchor" href="#\u5199render\u548Ctemplate\u7684\u533A\u522B" aria-hidden="true">#</a></h2><p>\u5C31\u50CF\u5B98\u65B9\u6587\u6863\u8BF4\u7684\uFF0C\u4E00\u822C\u6211\u4EEC\u4E0D\u5173\u5FC3<code>render\u51FD\u6570</code>\uFF0C\u4E5F\u4E0D\u5173\u5FC3<code>VNode</code>\u3001<code>\u771F\u5B9EDOM</code></p><p>\u4F46\u662F\u5B98\u65B9\u8FD8\u662F\u628Arender\u5F00\u653E\u51FA\u6765\u7ED9\u6211\u4EEC\u4F7F\u7528\uFF0C\u5E76\u5217\u4E3E\u4E86\u4E00\u4E9B\u4F7F\u7528\u573A\u666F</p><p>\u5982\u679C\u5355\u8BBA\u6211\u4EEC\u5F00\u53D1\u65F6\u5E94\u8BE5\u5199<code>render\u51FD\u6570</code>\u8FD8\u662F\u5199\u6A21\u7248<code>template</code>\uFF0C\u6211\u4EEC\u6765\u5206\u6790\u4E00\u4E0B\u533A\u522B\uFF1A</p><ul><li>\u4F18\u70B9 <ul><li>\u56E0\u4E3A\u6700\u7EC8\u6253\u5305\u540E\u7684\u4EE3\u7801\u90FD\u662F<code>render\u51FD\u6570</code>,\u6240\u4EE5\u5199<code>template</code>\u9700\u8981\u6253\u5305\u7684\u7F16\u8BD1\u8017\u65F6,render\u4F1A\u51CF\u5C11\u6253\u5305\u65F6\u95F4</li><li>\u7279\u5B9A\u573A\u666F\u4E0B\uFF0C\u5229\u7528js\u6BD4\u8D77\u7528template\u53EF\u4EE5\u66F4\u597D\u7684\u7F16\u5199\u5185\u5BB9</li></ul></li><li>\u7F3A\u70B9 <ul><li>\u989D\u5916\u7684\u5B66\u4E60\u6210\u672C</li><li>\u9700\u8981\u81EA\u5DF1\u5B9E\u73B0vue\u5728\u6A21\u7248\u4E0A\u63D0\u4F9B\u7684\u8BED\u6CD5\u7CD6,\u5982<code>v-show</code>\u3001<code>v-model</code></li></ul></li></ul><p>\u6CE8\u610F: \u5BB9\u6613\u6709\u7684\u8BEF\u533A\uFF0C\u5199 <code>render\u51FD\u6570</code> \u5E76\u4E0D\u4F1A\u63D0\u5347\u4EE3\u7801<strong>\u8FD0\u884C\u65F6\u7684\u901F\u5EA6</strong></p><h2 id="jsx" tabindex="-1">JSX <a class="header-anchor" href="#jsx" aria-hidden="true">#</a></h2><blockquote><p>\u8D77\u6E90\u4E8E<code>react</code>\uFF0C\u7528<code>html</code>\u8BED\u6CD5\u5199\u6210js\u7684<code>render</code></p></blockquote><p>\u6709\u8DA3\u7684\u662F:</p><ul><li>\u6211\u4EEC\u4E3A\u4E86\u5728<code>js</code>\u4E2D\u5199<code>html</code>\uFF0C\u800C\u5F15\u5165<code>\u6A21\u7248\u8BED\u6CD5</code></li><li>\u73B0\u5728\u53C8\u4E3A\u4E86\u5728<code>js</code>\u4E2D\u7528<code>html</code>\u8BED\u6CD5\uFF0C\u800C\u5F15\u5165<code>jsx\u8BED\u6CD5</code></li></ul><h3 id="\u8F6C\u8BD1" tabindex="-1">\u8F6C\u8BD1 <a class="header-anchor" href="#\u8F6C\u8BD1" aria-hidden="true">#</a></h3><blockquote><p><code>jsx</code>\u5E76\u4E0D\u662F\u6D4F\u89C8\u5668\u6216\u8005<code>nodejs</code>\u73AF\u5883\u8BA4\u8BC6\u7684\u8BED\u6CD5\uFF0C\u56E0\u6B64\u9700\u8981\u8F6C\u8BD1\u5DE5\u5177\u7684\u5E2E\u5FD9</p></blockquote><ul><li>\u5728<code>react</code>\u4E2D\uFF0C\u662F\u7528<code>.jsx</code>\u6587\u4EF6\u914D\u5408<code>babel</code>\uFF0C\u8F6C\u8BD1\u6210<code>render\u51FD\u6570</code></li><li>\u5728<code>vue</code>\u4E2D\uFF0C\u662F\u7528<code>.vue</code>\u6587\u4EF6\uFF0C\u914D\u5408\u539F\u6765\u7684<code>vue-loader</code>\u5916\u52A0vue\u7684<code>jsx-babel</code>,\u8F6C\u8BD1\u6210<code>render\u51FD\u6570</code></li></ul><p>\u5230\u8FD9\u91CC\uFF0C\u6211\u4EEC\u518D\u6765\u634B\u4E00\u4E0Bvue\u7684\u51E0\u79CD\u8F6C\u8BD1\u6D41\u7A0B</p><ol><li><code>runtime\u7248</code>vue\uFF0C\u5728\u5F00\u53D1\u9636\u6BB5\u76F4\u63A5\u5C31\u5199<code>render\u51FD\u6570</code>\uFF0C\u7ED9\u6D4F\u89C8\u5668\u8FD0\u884C</li><li><code>runtime\u7248</code>vue\uFF0C\u5199<code>template</code>\uFF0C\u901A\u8FC7\u6253\u5305\u5DE5\u5177\u8F6C\u8BD1\u4E3A<code>render\u51FD\u6570</code>\uFF0C\u7ED9\u6D4F\u89C8\u5668\u8FD0\u884C</li><li><code>\u5B8C\u6574\u7248</code>vue\uFF0C\u5199<code>template</code>\uFF0C\u5728\u6D4F\u89C8\u5668\u8FD0\u884C\u65F6\uFF0C\u901A\u8FC7\u5E93\u5185\u7684<code>vue.complier</code>\u89E3\u6790<code>template</code>\u6210<code>render\u51FD\u6570</code></li><li>\u4E0Evue\u7248\u672C\u65E0\u5173\uFF0C\u5F00\u53D1\u9636\u6BB5\u5199render\u5E76\u7528<code>jsx\u8BED\u6CD5</code>\uFF0C\u901A\u8FC7\u6253\u5305\u5DE5\u5177\u8F6C\u8BD1\u6210<code>render\u51FD\u6570</code>\uFF0C\u7ED9\u6D4F\u89C8\u5668\u8FD0\u884C</li></ol><p>\u601D\u8003\u{1F914}\uFF1A\u73B0\u5728\u7684\u5DE5\u7A0B\u652F\u4E0D\u652F\u6301\u5199<code>jsx</code>\uFF0C\u652F\u6301\u7684\u8BDD\uFF0C\u662F\u600E\u4E48\u914D\u7F6E\u6253\u5305\u5DE5\u5177\u6765\u652F\u6301\u7684\uFF1F</p><h2 id="\u51FD\u6570\u5F0F\u7EC4\u4EF6" tabindex="-1">\u51FD\u6570\u5F0F\u7EC4\u4EF6 <a class="header-anchor" href="#\u51FD\u6570\u5F0F\u7EC4\u4EF6" aria-hidden="true">#</a></h2><blockquote><p>\u5728vue3\u4E2D\u5E9F\u5F03</p></blockquote><p>\u4F18\u70B9\uFF1A</p><ul><li>\u7EC4\u4EF6\u521D\u59CB\u5316\uFF0C\u8F7B\u91CF <ul><li>\u6CA1\u6709\u7EC4\u4EF6\u5B9E\u4F8B\u5316(<code>new vnode.componentOptions.Ctor(options)</code>)\uFF0C\u51FD\u6570\u5F0F\u7EC4\u4EF6\u83B7\u53D6VNode\u4EC5\u4EC5\u662F\u666E\u901A\u51FD\u6570\u8C03\u7528</li><li>\u65E0\u516C\u5171\u5C5E\u6027\u3001\u65B9\u6CD5\u62F7\u8D1D</li><li>\u65E0\u751F\u547D\u5468\u671F\u94A9\u5B50\u8C03\u7528</li></ul></li><li>DOM\u6811\u6E32\u67D3\u3001\u66F4\u65B0\u901F\u5EA6\u5FEB(\u76F4\u63A5\u6302\u8F7D\u5230\u7236\u7EC4\u4EF6\u4E2D\uFF0C\u7F29\u77ED\u9996\u6B21\u6E32\u67D3\u3001diff\u66F4\u65B0\u8DEF\u5F84) <ul><li>\u7236\u7EC4\u4EF6\u751F\u6210VNode\u65F6\uFF0C\u51FD\u6570\u5F0F\u7EC4\u4EF6render\u65B9\u6CD5\u4F1A\u88AB\u8C03\u7528\uFF0C\u751F\u6210VNode\u6302\u8F7D\u5230\u7236\u7EC4\u4EF6children\u4E2D\uFF0Cpatch\u9636\u6BB5\u53EF\u76F4\u63A5\u8F6C\u6362\u6210\u771F\u662FDOM,\u666E\u901A\u7EC4\u4EF6\u5219\u5728createElm\u65F6\uFF0C\u8D70\u7EC4\u4EF6\u521D\u59CB\u5316\u6D41\u7A0B\u3002</li><li>diff\u66F4\u65B0\u65F6\uFF0C\u51FD\u6570\u5F0F\u7EC4\u4EF6\u8C03\u7528render\uFF0C\u76F4\u63A5\u521B\u5EFA\u666E\u901AVNode\uFF0C\u800C\u666E\u901A\u7EC4\u4EF6\u521B\u5EFA\u7684VNode\u7684\u662F\u5305\u542B\u7EC4\u4EF6\u4F5C\u7528\u57DF\u7684\uFF0Cdiff\u64CD\u4F5C\u65F6\uFF0C\u8FD8\u6709\u989D\u5916\u8C03\u7528updateChildComponent\u66F4\u65B0\u5C5E\u6027\u3001\u81EA\u5B9A\u4E49\u4E8B\u4EF6\u7B49\uFF0C\u8C03\u7528\u94FE\u8DEF\u4F1A\u6BD4\u8F83\u957F\u3002</li></ul></li></ul>`,49),s=[a];function t(p,l,r,i,u,h){return n(),o("div",null,s)}var m=e(c,[["render",t]]);export{v as __pageData,m as default};
